import React from "react";
import Header from "./Header";
import WineBottle from "./WineBottle";
import Footer from "./Footer";

const layoutStyle = {
  display: "flex",
  margin: 0,
  background: "beige",
  fontFamily: "YuMincho",
  letterSpacing: 3,
  fontWeight: 300,
  fontColor: "lightgray",
};

const StockLayout = () => (
  <div style={layoutStyle}>
    <Header />
    <div>
      <WineBottle />
      <WineBottle />
      <WineBottle />
      <WineBottle />
      <WineBottle />
      <WineBottle />
    </div>
    <Footer />
  </div>
);

export default StockLayout;
